import React from 'react';
import Block from'../../Block/Block'
var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Main extends React.Component {
    
    static GetContent(navigator)
    {
      const key = 'main';
      const title = 'главная';
      
      return {
        content: <Main key={key} title={title} navigator={navigator}/>,
        tab: <ROns.Tab key={key} label={title} />};
    }

    GetTitleBlocks(){
      var arr = ["/hello"]
      return (<ROns.LazyList
            length={arr.length}
            renderRow={(index) =>
              <Block url={arr[index]} navigator={this.props.navigator}/>
            }
          />);
    }

    render() {
      return (
        <ROns.Page>
          <ROns.Toolbar style={{'position': 'relative'}}>
            <div className="center"> {this.props.title} </div>
          </ROns.Toolbar>
          {this.GetTitleBlocks().bind(this)}
        </ROns.Page>
      );
    }
}

  export default Main
